//api.github.com/repos/awslabs/smithy-language-server/issues/34', 'number': 34, 'state': 'open', 'locked': False, 'title': 'Add maven conguration to smithy-build.json', 'user': {'login': 'srchase', 'id': 782571, 'node_id': 'MDQ6VXNlcjc4MjU3MQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/782571?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/srchase', 'html_url': 'https://github.com/srchase', 'followers_url': 'https://api.github.com/users/srchase/followers', 'following_url': 'https://api.github.com/users/srchase/following{/other_user}', 'gists_url': 'https://api.github.com/users/srchase/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/srchase/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/srchase/subscriptions', 'organizations_url': 'https://api.github.com/users/srchase/orgs', 'repos_url': 'https://api.github.com/users/srchase/repos', 'events_url': 'https://api.github.com/users/srchase/events{/privacy}', 'received_events_url': 'https://api.github.com/users/srchase/received_events', 'type': 'User', 'site_admin': False}, 'body': 'This CR updates SmithyBuildExtensions to use the following smithy-build.json format to allow setting Maven repositories and dependencies.
```
"maven": {
    "dependencies": ["com.foo.bar:custom-trait:0.0.1"],
    "repositories": [{
        "url": "https://url.to.maven.repo"
    }]
}
```

Existing smithy-build.json files will map `mavenDependency` and `mavenRepositories` arrays to the updated `maven` configuration. Configuration from the new `maven` key will be preferred over anything set in the deprecated `mavenDependency` and `mavenRepositories` keys.

Deprecation warnings with upgrade instructions are emitted to .smithy.lsp.log when the deprecated keys are encountered in smithy-build.json.

